import { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
    faRegistered,
    faSearch,
    faShoppingBasket,
    faShoppingCart,
    faSignIn,
    faSignOut,
    faTrash,
    faUser,
} from '@fortawesome/free-solid-svg-icons';
import classNames from 'classnames/bind';
import styles from './Header.module.scss';

const cx = classNames.bind(styles);

function Header() {
    const [toggleSearch, setToggleSearch] = useState(false);

    const [toggleShoppingCart, setToggleShoppingCart] = useState(false);

    const [toggleAccount, setToggleAccount] = useState(false);

    const navigate = useNavigate();

    const handleLogout = () => {
        localStorage.removeItem('accessToken');
        navigate('/login');
    };
    return (
        <div className={cx('wrapper')}>
            <header className={cx('header')}>
                <Link to="/" className={cx('logo')}>
                    <FontAwesomeIcon className={cx('icon-logo')} icon={faShoppingBasket} />{' '}
                    FoodStore
                </Link>
                <nav className={cx('navbar')}>
                    <Link to="/">Home</Link>
                    <Link to="/cart">Cart</Link>
                    <Link to="/products">Products</Link>
                    <Link to="/categories">Categories</Link>
                    <Link to="/review">Review</Link>
                    <Link to="/blog">Blog</Link>
                </nav>
                <div className={cx('icons')}>
                    <div className={cx('icon-btn')} onClick={() => setToggleSearch(!toggleSearch)}>
                        <FontAwesomeIcon icon={faSearch} />
                    </div>
                    <div
                        className={cx('icon-btn')}
                        onClick={() => setToggleShoppingCart(!toggleShoppingCart)}
                    >
                        <FontAwesomeIcon icon={faShoppingCart} />
                    </div>
                    <div
                        className={cx('icon-btn')}
                        onClick={() => setToggleAccount(!toggleAccount)}
                    >
                        <FontAwesomeIcon icon={faUser} />
                    </div>
                </div>
                {toggleSearch && (
                    <form action="" className={cx('search-form')}>
                        <input
                            type="search"
                            className={cx('search-box')}
                            placeholder="Tìm kiếm..."
                        />
                        <label>
                            <FontAwesomeIcon icon={faSearch} />
                        </label>
                    </form>
                )}
                {toggleShoppingCart && (
                    <div className={cx('shopping-cart')}>
                        <div className={cx('box')}>
                            <FontAwesomeIcon className={cx('icon-trash')} icon={faTrash} />
                            <img
                                src="data:image/jpeg;base64,"
                                alt="Qua oi"
                            />
                            <div className={cx('content')}>
                                <h3>Quả ổi</h3>
                                <span className={cx('price')}>10.000 dong</span>
                                <span className={cx('quantily')}> - qty: 1</span>
                            </div>
                        </div>
                        <div className={cx('box')}>
                            <FontAwesomeIcon className={cx('icon-trash')} icon={faTrash} />
                            <img
                                src="data:image/jpeg;base64,"
                                alt="Qua oi"
                            />
                            <div className={cx('content')}>
                                <h3>Quả ổi</h3>
                                <span className={cx('price')}>10.000 dong</span>
                                <span className={cx('quantily')}> - qty: 1</span>
                            </div>
                        </div>
                        <div className={cx('box')}>
                            <FontAwesomeIcon className={cx('icon-trash')} icon={faTrash} />
                            <img
                                src="data:image/jpeg;base64,"
                                alt="Qua oi"
                            />
                            <div className={cx('content')}>
                                <h3>Quả ổi</h3>
                                <span className={cx('price')}>10.000 dong</span>
                                <span className={cx('quantily')}> - qty: 1</span>
                            </div>
                        </div>
                        <div className={cx('box')}>
                            <FontAwesomeIcon className={cx('icon-trash')} icon={faTrash} />
                            <img
                                src="data:image/jpeg;base64,"
                                alt="Qua oi"
                            />
                            <div className={cx('content')}>
                                <h3>Quả ổi</h3>
                                <span className={cx('price')}>10.000 dong</span>
                                <span className={cx('quantily')}> - qty: 1</span>
                            </div>
                        </div>
                        <div className={cx('total')}>total: 150.000 dong</div>
                        <Link className={cx('checkout-btn')}>Thanh toán</Link>
                    </div>
                )}
                {toggleAccount && (
                    <div className={cx('account')}>
                        <div className={cx('account-btn')}>
                            <FontAwesomeIcon
                                className={cx('icon-singin')}
                                icon={faSignIn}
                            ></FontAwesomeIcon>
                            <Link to="/login">Đăng nhập</Link>
                        </div>
                        <div className={cx('account-btn')}>
                            <FontAwesomeIcon
                                className={cx('icon-register')}
                                icon={faRegistered}
                            ></FontAwesomeIcon>
                            <Link to="/register">Đăng ký</Link>
                        </div>
                        <div className={cx('account-btn')} onClick={handleLogout}>
                            <FontAwesomeIcon
                                className={cx('icon-singout')}
                                icon={faSignOut}
                            ></FontAwesomeIcon>
                            <Link>Đăng xuất</Link>
                        </div>
                    </div>
                )}
            </header>
        </div>
    );
}

export default Header;
